		map.on('mouseenter', 'route', mouseOverFunc);
		map.on('mouseenter', 'route2', mouseOverFunc);
			 
		map.on('mouseleave', 'route', function () {
			map.getCanvas().style.cursor = '';
			popup.remove();
		});			 
		map.on('mouseleave', 'route2', function () {
			map.getCanvas().style.cursor = '';
			popup.remove();
		});
	});
	</script>
		 
		</body>
